import React from 'react'
import { GoogleMap, Marker, InfoWindow } from 'react-google-maps'

function Map() {
	const mapInfo = {
		mapCenter: {
			lat: 46.48412,
			lng: 30.738760
		},
		defaultZoom: 14,
		selectedMarker: null,
	}
	
	return (
		<GoogleMap
			defaultZoom={mapInfo.defaultZoom}
			defaultCenter={mapInfo.mapCenter}
		/>
	)
}

export default Map
